,PRIVACY:"Confidentialité",KEYBINDS:"Raccourcis",TEXT_AND_IMAGES:"Texte & Images",CONNECTIONS:"Connexions",ACCOUNT:"Compte",NOTIFICATIONS:"Notifications",APPEARANCE:"Apparence",OVERLAY:"Overlay",LOCALE:"Langue",LOGOUT:"Déconnexion",SOUNDS:"",SOUND_MESSAGE:"Message",SOUND_DEAFEN:"Sourd",SOUND_UNDEAFEN:"Non-sourd",SOUND_MUTE:"Muet",SOUND_UNMUTE:"Non-muet",SOUND_CONNECTION_LOST:"Connexion perdue",SOUND_PTT_ACTIVATE:"APP activé",SOUND_PTT_DEACTIVATE:"APP désactivé",SOUND_USER_JOIN:"Arrivée utilisateur",SOUND_USER_LEAVE:"Départ utilisateur",RESET_VOICE_SETTINGS:"",RESET_VOICE_SETTINGS_BODY:"",LANGUAGE:"Langue",LANGUAGE_NOT_FOUND:"Langue introuvable ¯\\_ (ツ) _ / ¯",HELP_US_TRANSLATE_TITLE:"Aider à traduire Discord",HELP_US_TRANSLATE_BODY:"La localisation de Discord provient de la communauté.\nSi vous souhaitez voir Discord traduit dans une autre langue, nous serions ravis d'accepter votre aide.\n\nPour postuler, visitez notre [plateforme de traduction]({translationSiteURL}).",CHECKING_FOR_UPDATES:"Vérification des mises à jour",UPDATE_AVAILABLE:"Téléchargement de mise(s) à jour",UPDATE_DOWNLOADED:"Mise(s) à jour prête(s) !",STATUS_ONLINE:"En ligne",STATUS_OFFLINE:"Hors ligne",NO_INPUT_DEVICES:"Aucun périphérique d'entrée",NO_OUTPUT_DEVICES:"Aucun périphérique de sortie",DEFAULT:"Par défaut",INPUT_SOURCE:"Source {index}",CONNECTION_STATUS_CONNECTED:"Connecté",CONNECTION_STATUS_CONNECTING:"Connexion",CONNECTION_STATUS_AUTHENTICATING:"Authentification",CONNECTION_STATUS_AWAITING_ENDPOINT:"En attente du terminal",CONNECTION_STATUS_DISCONNECTED:"Déconnecté",CONNECTION_STATUS_VOICE_CONNECTED:"Vocal connecté",CONNECTION_STATUS_VOICE_CONNECTING:"Connexion vocale",CONNECTION_STATUS_ICE_CHECKING:"Vérification ICE",CONNECTION_STATUS_NO_ROUTE:"Pas de route",CONNECTION_STATUS_VOICE_DISCONNECTED:"Voix déconnectée",IP_ADDRESS_SECURED:"Adresse IP sécurisée",VOICE_DISCONNECT:"Déconnexion",VOICE_CONNECTION_INFO:"",VOICE_CONNECTION:"",VOICE_CONNECTION_STATE_AWAITING_ENDPOINT:"",VOICE_CONNECTION_STATE_CONNECTING:"",VOICE_CONNECTION_STATE_AUTHENTICATING:"",VOICE_CONNECTION_STATE_VOICE_CONNECTING:"",VOICE_CONNECTION_STATE_ICE_CHECKING:"",VOICE_CONNECTION_STATE_NO_ROUTE:"",VOICE_CONNECTION_STATE_VOICE_CONNECTED:"",VOICE_CONNECTION_STATE_DISCONNECTED:"",TUTORIAL_SKIP:"Déjà un pro ? [Passer l'astuce](onSkipClick)",TUTORIAL_CLOSE:"Compris !",CHANNEL_MUTE_TOOLTIP:"Rendre muet un salon empêche tout type d'indicateurs et notifications d'apparaître à moins que vous soyez mentionné.",SHOW_MUTED:"Montrer {n} muet(s)",HIDE_MUTED:"Cacher {n} Muet(s)",WELCOME_MESSAGE_OWNER_TITLE:"Bienvenue sur votre serveur, {username} !",WELCOME_MESSAGE_TITLE:"Bienvenue sur le serveur, {username} !",WELCOME_MESSAGE_INSTANT_INVITE:"**Invitez vos amis** sur ce serveur en cliquant sur un bouton [partager](onShareClick) lorsque vous êtes prêt.",WELCOME_MESSAGE_DESKTOP_APPS:"**Téléchargez** l'[application bureau](onDownloadClick) pour un appuyer-pour-parler fonctionnel sur l'ensemble de votre ordinateur, une consommation moindre de votre bande passante et processeur, et plus encore.",WELCOME_MESSAGE_TUTORIAL:"**Découvrez Discord** à votre propre rythme en cliquant sur les indicateurs de quête.",WELCOME_MESSAGE_MOBILE_APPS:"**Restez connecté** à votre serveur depuis [votre smartphone](onDownloadClick) et utilisez-le même en jouant sur console.",WELCOME_MESSAGE_SUPPORT:"**Contactez nous** via notre [service d'assistance]({supportURL}) ou sur Twitter [@discordapp]({twitterURL}) si vous avez des questions ou besoin d'aide.",TIP_VOICE_CONVERSATIONS_TITLE:"Haussez votre voix",TIP_VOICE_CONVERSATIONS_BODY:"Ceci est votre **panneau de contrôle vocal**.\n\nUtilisez ces boutons pour activer/désactiver votre microphone, vous rendre sourd, ou modifier vos paramètres.\nVous pouvez changer le fonctionnement de votre micro de **Détection de voix à Appuyer-pour-parler** en cliquant sur la roue dentée.",TIP_WRITING_MESSAGES_TITLE:"Avoir une conversation",TIP_WRITING_MESSAGES_BODY:"C'est ici que vous écrirez vos opinions et idées.\n\nPour d'embellir les choses, la syntaxe Markdown est disponible afin de **vous faire entendre** ou encore pour __souligner vos propos__. Vous pouvez également **glisser et déposer** ici même des images ou fichiers afin de partager rapidement des GIFs de chats... tout en restant raisonnable.",TIP_ORGANIZE_BY_TOPIC_TITLE:"Organiser par salons",TIP_ORGANIZE_BY_TOPIC_BODY:"**Les salons textuels** vous permettent d'organiser vos conversations sur des sujets différents. Vous pouvez sauter d'un salon de messagerie à l'autre facilement et même **@mentionner** vos amis pour leur envoyer une notification sur leur bureau ou téléphone.\n\n**Les salons vocaux** vous permettent d'organiser vos conversations en groupes de taille plus ou moins grande comme vous le souhaitez. Cliquez sur un salon vocal pour rejoindre la conversation. Vous resterez dans ce salon vocal même si vous changez de salon textuel, vous pouvez utiliser les deux en même temps !",TIP_WHOS_ONLINE_TITLE:"À quoi jouez-vous ?",TIP_WHOS_ONLINE_BODY:"Cette liste montre qui est dans le salon actuel.\n\nToute personne utilisant l'application bureau indiquera également le jeu auquel il est en train de jouer. En cliquant sur un utilisateur vous révélerez ses **réglages individuels** telles que le volume du micro de cet utilisateur ou les commandes administrateurs liées à cet utilisateur.",TIP_INSTANT_INVITE_TITLE:"Invitez vos amis",TIP_INSTANT_INVITE_BODY:"Déplacez votre souris sur n'importe quel salon textuel ou vocal pour révéler le bouton de partage. Utilisez le lien généré pour inviter des gens directement dans le salon de votre choix.\n\nLes liens d'invitation avancés vous permettent de définir des restrictions d'usages comme le nombre de personnes qui peuvent utiliser ce lien, le temps durant lequel il sera utilisable, ou même le rendre lisible par un humain pour un partage facile par exemple dans le cas d'un jeu ne possédant pas de messagerie où les liens sont cliquables.",TIP_SERVER_SETTINGS_TITLE:"Contrôlez votre serveur",TIP_SERVER_SETTINGS_BODY:"Cliquez ici afin d'accéder aux paramètres de votre serveur.\n\nVous pouvez modifier toutes sortes de choses comme les permissions, la région de votre serveur, créer un salon AFK, gérer les invitations, gérer les utilisateurs bannis, ou même supprimer entièrement votre serveur.",TIP_DIRECT_MESSAGES_TITLE:"Démarrer une conversation privée",TIP_DIRECT_MESSAGES_BODY:"Visualisez tous les gens sur vos serveurs via cette liste.\n\nVous pouvez commencer une discussion privée avec un ami en le sélectionnant et en commençant à écrire ! Utile pour envoyer directement une notification, même aux personnes absentes.",TIP_CREATE_MORE_SERVERS_TITLE:"Des serveurs partout !",TIP_CREATE_MORE_SERVERS_BODY:"Cliquez sur le bouton plus pour créer un nouveau serveur.\n\nComme les serveurs sont gratuits, vous pouvez en créer autant que vous le voulez. Chaque serveur vous permet d'avoir un endroit unique pour chaque groupe de personnes. Vous pouvez aussi supprimer vos serveurs si vous n'en n'avez plus besoin.",TIP_CREATE_FIRST_SERVER_TITLE:"Créer votre propre serveur",TIP_CREATE_FIRST_SERVER_BODY:"Cliquez sur ce bouton pour créer votre propre serveur.\n\nChaque serveur est un endroit unique pour différents groupes de personnes. Vous pouvez aussi supprimer un serveur si vous n'en n'avez plus besoin. Le meilleur : les serveurs étant gratuits, vous pouvez en créer autant que vous le voulez.",TIP_FRIENDS_LIST_TITLE:"Voir vos amis",TIP_FRIENDS_LIST_BODY:"Cliquez ici pour voir vos messages privés ainsi que le statut de tout les utilisateurs de vos serveurs.\n\nLorsque vous recevez un message privé, il apparaîtra sous votre avatar pour être accessible facilement.",BAN_CONFIRM_TITLE:"Donnez un coup de Banhammer à « {username} »",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Supprimer l'historique des messages",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Ne rien supprimer",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Dernières 24 heures",DELETE_MESSAGE_HISTORY_OP