NG:"",VOICE_CONNECTION_STATE_NO_ROUTE:"",VOICE_CONNECTION_STATE_VOICE_CONNECTED:"",VOICE_CONNECTION_STATE_DISCONNECTED:"",TUTORIAL_SKIP:"Już to wiesz? [Pomiń porady](onSkipClick)",TUTORIAL_CLOSE:"Zrozumiano!",CHANNEL_MUTE_TOOLTIP:"Wyciszenie kanału zapobiega pojawianiu się wskaźników i powiadomień, chyba że jesteś wymieniony.",SHOW_MUTED:"",HIDE_MUTED:"",WELCOME_MESSAGE_OWNER_TITLE:"Witaj na swoim własnym serwerze, {username}!",WELCOME_MESSAGE_TITLE:"Witaj na serwerze, {username}!",WELCOME_MESSAGE_INSTANT_INVITE:"**Zaproś swoich przyjaciół** do tego serwera klikając [Udostępnij](onShareClick) gdy jesteś gotowy.",WELCOME_MESSAGE_DESKTOP_APPS:"**Pobierz** [aplikację desktopową](onDownloadClick) dla ogólnosystemowego Naciśnij i Mów, mniejszego zużycia CPU i łącza internetowego oraz innych funkcji.",WELCOME_MESSAGE_TUTORIAL:"**Dowiedz się więcej o Discord** w swoim tempie, eksplorując pływające wskaźniki z zadaniami.",WELCOME_MESSAGE_MOBILE_APPS:"**Pozostań w kontakcie** ze swoim serwerem ze [swojego smartfona](onDownloadClick), a nawet używaj Discord grając na konsoli.",WELCOME_MESSAGE_SUPPORT:"**Skontaktuj się** z nami poprzez [nasze wsparcie techniczne]({supportURL}) lub na Twitterze [@discordapp]({twitterURL}) jeśli masz jakieś pytania lub potrzebujesz pomocy.",TIP_VOICE_CONVERSATIONS_TITLE:"Mów głośniej",TIP_VOICE_CONVERSATIONS_BODY:"To jest twój **panel sterowania głosem.**\n\nUżyj tych przycisków aby włączyć swój mikrofon, wyłączyć dźwięk lub zmodyfikować ustawienia.\nMożesz zmienić swój tryb mówienia z **Aktywacji głosowej na Naciśnij i Mów** klikając na zębatkę.",TIP_WRITING_MESSAGES_TITLE:"Porozmawiaj z innymi",TIP_WRITING_MESSAGES_BODY:"To jest miejsce gdzie będzisz wpisywał wszystkie swoje opcje i pomysły.\n\nAby było wszystko tip-top, dołączyliśmy składnę dla zaznaczeń, żeby wskazać **coś ważnego** lub\n__tupnąć w podłogę.__ Możesz także **przeciągać i upuszczać** obrazki oraz pliki w tym miejscu aby szybko\nsię podzielić tymi kocimi gifami. Tylko nie przesadzaj.",TIP_ORGANIZE_BY_TOPIC_TITLE:"",TIP_ORGANIZE_BY_TOPIC_BODY:"",TIP_WHOS_ONLINE_TITLE:"W co grasz?",TIP_WHOS_ONLINE_BODY:"Ta lista pokazuje kto jest obecny na kanale.\n\nPrzy każdym kto używa pobranej aplikacji widoczny będzie również tytuł obecnie uruchomionej gry. Kliknięcie na nazwę użytkownika odkryje jego **ustawienia indywidualne**, jak kontrola głośności czy opcje administracyjne.",TIP_INSTANT_INVITE_TITLE:"Zaproś przyjaciół",TIP_INSTANT_INVITE_BODY:"Najedź myszką na dowolny kanał tekstowy lub głosowy by odkryć przycisk dzielenia się. Użyj wygenerowanego linku by zapraszać ludzi bezpośrednio do wybranego kanału.\n\nZaawansowane Linki Zaproszeń pozwalają ci nałożyć ograniczenia użycia, takie jak maksymalna ilość ludzi którzy mogą dołączyć używając danego linku, jak długo link pozostanie aktywny, a nawet pozwalają ci uczynić link czytelnym dla ludzi dla łatwiejszego dzielenia się nim na chatach które nie pozwalają na klikanie linków.",TIP_SERVER_SETTINGS_TITLE:"Kontroluj swój serwer",TIP_SERVER_SETTINGS_BODY:"Kliknij tutaj, aby uzyskać dostęp do ustawień Twojego serwera.\n\nMożesz modyfikować wiele różnych rzeczy, takich jak uprawnienia i role, wybór regionu swoich serwerów głosowych,\nustawienia kanału AFK, zarządzanie linkami z zaproszeniami, zbanowanymi użytkownikami lub nawet całkowite usunięcie twojego serweru.",TIP_DIRECT_MESSAGES_TITLE:"Rozpocznij rozmowę prywatną",TIP_DIRECT_MESSAGES_BODY:"Możesz widzieć wszystkich znajomych ze wszystkich Twoich serwerów.\n\nZ każdym z nich możesz rozpocząć prywatną konwersacje poprzez wybranie znajomego z listy. Prywatne wiadomości są świetnym sposobem by skontaktować się z pojedynczą osobą, nawet jeśli są zajęci czymś innym. Jest to możliwe dzięki powiadomieniom na ich urządzeniu.",TIP_CREATE_MORE_SERVERS_TITLE:"Serwery wszędzie!",TIP_CREATE_MORE_SERVERS_BODY:"Kliknij przycisk plusa by utworzyć nowy serwer.\n\nPonieważ serwery są darmowe, możesz stworzyć ich dowolną liczbę. Każdy serwer pozwala Ci stworzyć unikatowe miejsce dla różnych grup ludzi. Możesz również usunąć serwery, gdy przestaną być potrzebne.",TIP_CREATE_FIRST_SERVER_TITLE:"Stwórz swój własny serwer",TIP_CREATE_FIRST_SERVER_BODY:"Kliknij na plus, aby stworzyć swój własny serwer.\n\nKażdy serwer pozwala Ci na posiadanie własnego miejsca dla różnych grup znajomych. Możesz zawsze usunąć serwer jeśli nie ma już na niego potrzeby. A co najlepsze, możesz tworzyć tyle serwerów ile Ci się podoba, ponieważ wszystkie są za darmo.",TIP_FRIENDS_LIST_TITLE:"Zobacz znajomych",TIP_FRIENDS_LIST_BODY:"Kliknij tutaj, aby wyświetlić prywatne wiadomości i status każdego użytkownika na wszystkich swoich serwerach.\n\nOtrzymane prywatne wiadomości ukażą się pod Twoim awatarem dla szybkiego i łatwego dostępu.",BAN_CONFIRM_TITLE:"Grzmotnij Ban Hammerem w '{username}'",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Usuń historię wiadomości",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Nie usuwaj",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Ostatnie 24 godziny",DELETE_MESSAGE_HISTORY_OPTION_7D:"Ostatnie 7 dni",NO:"Nie",YES:"Tak",CLOSE:"Zamknij",SEND:"Wyślij",CHOOSE:"Wybierz",SAVE:"Zapisz",NO_CAMERA_ACCESS:"",NO_PHOTOS_ACCESS:"Discord nie ma dostępu do Twoich zdjęć",ENABLE_PRIVACY_ACCESS:"Możesz włączyć dostęp w ustawieniach prywatności.",NO_PHOTO_IN_CAMERA_ROLL:"Brak zdjęć z aparatu",DELETE_MESSAGE_BODY_MOBILE:"",JOIN_VOICE_CHANNEL:"Połączyć z tym kanałem głosowym?",LEAVE_SERVER_BODY_MOBILE:"Czy na pewno chcesz opuścić {name}?",KICK_USER_TITLE:"Wyrzuć '{user}'",KICK_USER_BODY:"Czy na pewno chcesz wyrzucić {user}? Będzie on mógł wrócić ponownie z nowym zaproszeniem.",BAN_USER_BODY:"Czy na pewno chcesz zbanować {user}? Nie będzie on mógł wrócić dopóki go nie odbanujesz.",VOICE_DISCONNECT_TITLE:"Rozłącz czat głosowy",VOICE_DISCONNECT_BODY:"Rozłączyć z tym serwerem głosowym?",JOIN_AFK_CHANNEL_BODY:"Wygląda na to, że dołączyłeś do kanału AFK. Nie możesz mówić na tym kanale.",TAKE_PHOTO:"Zrób zdjęcie",CAMERA_ROLL:"",IMAGE:"Obrazek",REPORT:"Zgłoś",REPORTED:"Zgłoszono",CL