CHANNEL_MUTE_TOOLTIP:"När du tystar en kanal visas inga notiser eller indikatorer för olästa meddelanden om du inte omnämns.",SHOW_MUTED:"Visa {n} tystade",HIDE_MUTED:"Göm {n} tystade",WELCOME_MESSAGE_OWNER_TITLE:"Välkommen till din server, {username}!",WELCOME_MESSAGE_TITLE:"Välkommen till servern, {username}!",WELCOME_MESSAGE_INSTANT_INVITE:"**Bjud in dina vänner** till den här servern genom att klicka på en [dela-knapp](onShareClick) när du är redo.",WELCOME_MESSAGE_DESKTOP_APPS:"**Hämta** [appen](onDownloadClick) för tryck-för-tal på hela systemet, lägre CPU-användning, mindre bandbredd och många andra fördelar.",WELCOME_MESSAGE_TUTORIAL:"**Lär dig mer om Discord** i din egen takt genom att utforska det flytande märkena.",WELCOME_MESSAGE_MOBILE_APPS:"**Förbli ansluten** till din server från [din smartphone](onDownloadClick), då kan du även använda Discord när du spelar konsollspel.",WELCOME_MESSAGE_SUPPORT:"**Nå oss** via [vårt hjälpcenter]({supportURL}) eller på Twitter [@discordapp]({twitterURL}) om du har några frågor eller behöver hjälp.",TIP_VOICE_CONVERSATIONS_TITLE:"Gör din röst hörd",TIP_VOICE_CONVERSATIONS_BODY:"Detta är din **kontrollpanel för röst.**\n\nAnvänd dessa knappar för att aktivera din mikrofon, stänga av ljudet eller ändra inställningar. Du kan ändra ingångsläge mellan **röstaktivitet** och **tryck-för-tal** genom att klicka på kugghjulet.",TIP_WRITING_MESSAGES_TITLE:"Ha en konversation",TIP_WRITING_MESSAGES_BODY:"Det är här du skriver alla dina åsikter och idéer.\n\nFör att göra det riktigt snyggt så kan du använda Markdown-syntax så du kan **sjunga** eller __stampa fötterna.__ Du kan också **dra & släppa** bilder och filer här för att enkelt dela de där animerade katterna. Inte för många bara.",TIP_ORGANIZE_BY_TOPIC_TITLE:"Organisera med kanaler",TIP_ORGANIZE_BY_TOPIC_BODY:"**Textkanaler** låter dig separera dina chattar efter ämne. Du kan enkelt hoppa runt bland kanaler och även använda **@namn** för att skicka notiser till dina vänners dator eller telefon.\n\n**Ljudkanaler** låter dig separera dina konversationer i grupper så stora eller små som du vill. Klicka på en kanal för att gå med i konversationen. Du kommer att stanna i den ljudkanalen även om du byter textkanal också!",TIP_WHOS_ONLINE_TITLE:"Vad spelar du?",TIP_WHOS_ONLINE_BODY:"Denna lista visar vem som är i den aktuella kanalen.\n\nAlla som använder skrivbords-appen visar även vilket spel de spelar för närvarande. Klicka på en användare för att visa **individuella inställningar** så som volymkontroller eller admin kontroller.",TIP_INSTANT_INVITE_TITLE:"Bjud in dina vänner",TIP_INSTANT_INVITE_BODY:"För musen över en text- eller röstkanal för att visa dela-knappen. Använd den genererade länken för att bjuda in vänner direkt till den valda kanalen.\n\nAvancerade inbjudnings-länkar gör det möjligt att sätta begränsningar så som hur många som kan använda inbjudan, hur länge den är giltig samt att göra den läsbar för enklare delning.",TIP_SERVER_SETTINGS_TITLE:"Kontrollera din server",TIP_SERVER_SETTINGS_BODY:"Klicka här för att komma åt serverns inställningar.\n\nDu kan ändra alla möjliga saker, som rättigheter och roller, välja röstserverns region, ställa in en AFK-kanal, hantera inbjudningslänkar och bannlysta medlemmar eller till och med ta bort din server helt.",TIP_DIRECT_MESSAGES_TITLE:"Börja en privat konversation",TIP_DIRECT_MESSAGES_BODY:"Se alla användare på dina servrar i denna lista.\n\nDu kan ha en privat konversation genom att välja en vän och chatta! Direktmeddelanden är ett utmärkt sätt att nå människor via notiser även när de är AFK.",TIP_CREATE_MORE_SERVERS_TITLE:"Servrar överallt!",TIP_CREATE_MORE_SERVERS_BODY:"Klicka denna plus-knapp för att skapa en ny server.\n\nEftersom servrar är gratis, kan du skapa så många du behöver. Varje server låter dig ha en unik plats för olika grupper av människor. Du kan radera en server om du inte längre behöver den.",TIP_CREATE_FIRST_SERVER_TITLE:"Skapa din egen server",TIP_CREATE_FIRST_SERVER_BODY:"Klicka denna plus-knapp för att skapa din egen server.\n\nVarje server låter dig ha en unik plats för olika grupper av människor. Du kan radera en server om du inte längre behöver den. Det bästa är att du kan skapa så många servar du vill, de är gratis.",TIP_FRIENDS_LIST_TITLE:"Se dina vänner",TIP_FRIENDS_LIST_BODY:"Klicka här för att visa dina direktmeddelanden och se status för alla på dina servrar.\n\nNär du får ett direktmeddelande, visas det här under din avatar för enkel åtkomst.",BAN_CONFIRM_TITLE:"Svinga bannlysnings-hammaren på '{username}'",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Radera meddelandehistorik",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Radera inte något",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Föregående 24 timmar",DELETE_MESSAGE_HISTORY_OPTION_7D:"Föregående 7 dagar",NO:"Nej",YES:"Ja",CLOSE:"Stäng",SEND:"Skicka",CHOOSE:"Välj",SAVE:"Spara",NO_CAMERA_ACCESS:"Discord har inte tillgång till din kamera",NO_PHOTOS_ACCESS:"Discord har inte tillgång till dina foton",ENABLE_PRIVACY_ACCESS:"Du kan ge åtkomst under iOS integritetsskydds-inställningar.",NO_PHOTO_IN_CAMERA_ROLL:"Inga bilder i kamerarullen",DELETE_MESSAGE_BODY_MOBILE:"",JOIN_VOICE_CHANNEL:"Anslut till denna röstkanal?",LEAVE_SERVER_BODY_MOBILE:"Är du säker på att du vill lämna {name}?",KICK_USER_TITLE:"Sparka '{user}'",KICK_USER_BODY:"Är du säker på att du vill sparka {user}? De kommer att kunna återansluta till servern med en ny inbjudan.",BAN_USER_BODY:"Är du säker på att du vill bannlysa {user}? De kommer inte kunna komma tillbaka om du inte tar bort bannlysningen.",VOICE_DISCONNECT_TITLE:"Koppla från röst",VOICE_DISCONNECT_BODY:"Koppla från denna röstserver?",JOIN_AFK_CHANNEL_BODY:"Det verkar som du gått med i AFK-kanalen. Du kan inte prata i denna kanal.",TAKE_PHOTO:"Ta foto",CAMERA_ROLL:"Kamerarulle",IMAGE:"Bild",REPORT:"Anmäl",REPORTED:"Anmäld",CLOSE_DM:"Stäng DM",EDIT_MESSAGE:"Redigera meddelande",DELETE_MESSAGE:"Radera meddelande",EDITING_MESSAGE:"Redigerar meddelande",READ_ONLY_CHANNE