NIZE_BY_TOPIC_BODY:"**文字頻道** 讓您可以按主題分流聊天訊息，同時輕鬆的在頻道間切換。\n還可以使用 **@提及** 功能來對朋友的桌上電腦或是手機傳送通知。\n\n**語音頻道** 讓您可以將語音聊天依需求分開成各種大小群組。\n點擊一個頻道即可加入聊天，而且當您切換文字頻道的時候是不會影響語音頻道!",TIP_WHOS_ONLINE_TITLE:"您正在玩什麼?",TIP_WHOS_ONLINE_BODY:"這個名單顯示目前在這個頻道的人員。\n\n桌面程式版本將會同時顯示他們正在遊玩的遊戲。點擊該使用者會顯示 **個人設定** 例如音量設定或者管理員的選項。",TIP_INSTANT_INVITE_TITLE:"邀請您的朋友",TIP_INSTANT_INVITE_BODY:"把滑鼠指標放在任何文字或者語音頻道上會顯示分享鍵。使用產生連結來邀請使用者直接進入頻道。\n\n進階邀請連結容許你設定限制例如連接使用次數，連結有效時間，或是使用可讀文字連結更易閱讀。",TIP_SERVER_SETTINGS_TITLE:"控制您的伺服器",TIP_SERVER_SETTINGS_BODY:"按這以存取您的伺服器設定。\n\n您可以修改所有例如權限，身份組，選擇語音伺服器地區，設立閒置頻道，管理邀請連結，管理封禁使用者，甚至可以永久刪除伺服器。",TIP_DIRECT_MESSAGES_TITLE:"開始私人對話",TIP_DIRECT_MESSAGES_BODY:"在這個列表中可以看到在您所有伺服器的上的每一個使用者。\n\n選擇一個朋友即可開始一對一的私人訊息！\n在其他人暫離的時候，私人訊息以及通知功能是您最好的找人方式。",TIP_CREATE_MORE_SERVERS_TITLE:"伺服器無所不在!",TIP_CREATE_MORE_SERVERS_BODY:"按此加號按鈕來建立新伺服器。\n\n因為伺服器是免費的，所以您可以替各個不同團體的朋友們建立獨立的伺服器。也可以刪除不再使用的伺服器。",TIP_CREATE_FIRST_SERVER_TITLE:"建立您自己的伺服器",TIP_CREATE_FIRST_SERVER_BODY:"按此加號按鈕來建立您自己的伺服器。\n\n您可以替各個不同團體的朋友圈創建獨立的伺服器。也可以刪除不再使用的伺服器。最棒的是，因為伺服器是免費的，您想建立幾個都可以。",TIP_FRIENDS_LIST_TITLE:"看您的朋友們",TIP_FRIENDS_LIST_BODY:"按此觀看您的私人訊息和查看位於您的伺服器的使用者的狀態。\n\n當您接收到私訊的時候，會顯示在您的頭像底下以方便查看。",BAN_CONFIRM_TITLE:"朝著 '{username}' 使用了封禁之槌！",FORM_LABEL_DELETE_MESSAGE_HISTORY:"刪除訊息歷史",DELETE_MESSAGE_HISTORY_OPTION_NONE:"什麼都別刪除",DELETE_MESSAGE_HISTORY_OPTION_24HR:"過去 24 小時內",DELETE_MESSAGE_HISTORY_OPTION_7D:"過去 7 天內",NO:"否",YES:"是",CLOSE:"關閉",SEND:"傳送",CHOOSE:"選擇",SAVE:"儲存",NO_CAMERA_ACCESS:"Discord 並沒有存取你的照相機的權限",NO_PHOTOS_ACCESS:"Discord 並沒有存取你的照片的權限",ENABLE_PRIVACY_ACCESS:"您可以在隱私設定中啟用存取權限。",NO_PHOTO_IN_CAMERA_ROLL:"相機膠捲中沒有照片",DELETE_MESSAGE_BODY_MOBILE:"",JOIN_VOICE_CHANNEL:"連接這個語音頻道？",LEAVE_SERVER_BODY_MOBILE:"您確定要退出 {name}?",KICK_USER_TITLE:"踢除 '{user}'",KICK_USER_BODY:"您確定要踢除 {user}? 他們可以透過新的邀請再次加入。",BAN_USER_BODY:"你確定要封鎖{user} 嗎？除非你解除對他們的封鎖，否則他們不能重新加入。",VOICE_DISCONNECT_TITLE:"語音斷線",VOICE_DISCONNECT_BODY:"從這個語音頻道中斷線？",JOIN_AFK_CHANNEL_BODY:"看來您進入了閒置頻道。您不能在這個頻道中說話。",TAKE_PHOTO:"拍攝照片",CAMERA_ROLL:"相機膠捲",IMAGE:"圖片",REPORT:"檢舉",R